import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [{
    id: '1', title: 'sss', amount: '67', date: new Date(2021, 2, 3)
  },
{ id: '2', title: 'aaa', amount: '56', date: new Date(2021, 4, 8) },
  { id: '3', title: 'fff', amount: '76', date: new Date(2020 ,4 ,5) }]
  return (
    <div>
      <h1>Expense Items</h1>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
    </div>
  );
}

export default App;
